import React from "react";
import { Button } from "reactstrap";
import "./css-components/nav-bar.css";
import logo from "./errandslogo.jpeg";

function Navbar() {
  return (
    <div clfassName="bar">
      <Button color="success" className="login-nav-bar">
        <a href="#App">Login</a>
      </Button>
      <img src={logo} alt="logo" className="logo-nav-bar" />
    </div>
  );
}

export default Navbar;
